all_emoji_list = list(dict.fromkeys([a for a in all_emojis]))

conversion_table = [("ðŸ€", 1)]

for i, c in enumerate(all_emoji_list):
    conversion_table.append((c, 2 ** (i+1)))

conversion_table.reverse()

def to_roman(i: int) -> str:
    ret = ""

    while i > 0:
        for k, v in conversion_table:
            if v <= i:
                ret += k
                i -= v
                break

    return ret

def main():
    msg = sys.argv[1]
    msg_bytes = msg.encode('utf-8')
    msg_int = int.from_bytes(msg_bytes, 'little')

    print(to_roman(msg_int))

if __name__ == "__main__":
    main()